/* -------------------------*/


function App() {
  return (
    <div className="App">
      <div className="mainContainer">
        <label className="labelbitch">THIS AINT NO PLACE </label>

      <header className="App-header">

        <p>
          Edit <code>src/App.js</code> and save to reload.
